const templateSlides = [
  <div
    style={{
      backgroundColor: '#ecc',
      height: 300,
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
    }}
  >
    Slide 0
  </div>,
  <div
    style={{
      backgroundColor: '#cec',
      height: 300,
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
    }}
  >
    Slide 1
  </div>,
];

const templateContents = [
  <div
    style={{
      backgroundColor: '#cce',
      height: 300,
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
    }}
  >
    Content 0
  </div>,
  <div
    style={{
      backgroundColor: '#eec',
      height: 300,
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
    }}
  >
    Content 1
  </div>,
];

export { templateSlides, templateContents };
